    declare ini, case_mode, cname, dyn, is_api varchar; 
    ini := virtuoso_ini_path (); 
    case_mode := cfg_item_value (ini, 'Parameters', 'CaseMode'); 
    cname := cfg_item_value (ini, 'URIQA', 'DefaultHost'); 
    dyn := cfg_item_value (ini, 'URIQA', 'DynamicLocal'); 
    is_api := registry_get ('__blog_api_tests__'); 
    if (lt (sys_stat ('st_dbms_ver'), '05.00.3028') or __proc_exists ('HTTP_STATUS_SET',2) is null) 
      { 
         result ('ERROR', 'The ods package requires server version 05.00.3028 or greater'); 
	 signal ('FATAL', 'The ods package requires server version 05.00.3028 or greater'); 
      } 
     if (VAD_CHECK_VERSION ('wa') is not null and VAD_CHECK_VERSION ('Framework') is null) 
       {
          DB.DBA.VAD_RENAME ('wa', 'Framework');
       }
      if (not isstring (is_api) and case_mode <> '2') { 
	  result ('ERROR', 'The ODS Framework needs server to run in CaseMode 2, please check your INI file.'); 
	  signal ('FATAL', 'The ODS Framework needs server to run in CaseMode 2, please check your INI file.'); 
	}
      if (not isstring (is_api) and length (cname) = 0) { 
	  result ('ERROR', 'The ODS Framework needs DefaultHost to be specified in URIQA INI section.'); 
	  signal ('FATAL', 'The ODS Framework needs DefaultHost to be specified in URIQA INI section.'); 
 	}

